import React from 'react'

const MainContent = (props) => {
    return (
        <div>
            <h3>{props.name}</h3>
            <h3>{props.age}</h3>
            <h3>{props.birthday}</h3>
            <img src={props.img[1]} alt={props.name} />

        </div>
    )
}

export default MainContent
